import React from 'react'
import styled from 'styled-components'

const Container = styled.div`
    h2, h3{
        font-family: Ruberoid;
        font-weight: 500; 
    }

    h2{
        font-size: 1.8em;  
    }

    h3{
        font-size: 1.5em;
    }

    li{
        border-top: 1.5px solid black;
        padding: 3em 0;
        font-size: .9em;
    }
`

function Privacy3() {
  return (
    <Container>

    </Container>
  )
}

export default Privacy3
